import React, { Component } from 'react'
import Toolbar from '../../components/UI/Toolbar/Toolbar'

class Search extends Component{
    render(){
        return(
            <div>
                <Toolbar/>
                <div>
                    <form>
                        <input type="text" name="place" placeholder="City"></input>
                        <input type="text" name="start" placeholder="Star-Hotel(1-5)"></input>
                        <input type="date" name="firstdate" placeholder="Check-in Date"></input>
                        <input type="date" name="seconddate" placeholder="Check-out Date"></input>
                        <input type="text" name="rooms" placeholder="No. of Rooms"></input>
                    </form> 
                </div>
            </div>
        )
    }
}

export default Search;
